import React from "react";
import "./Navbar.css";

function Navbar() {
  return (
    <div className="container">
      <div className="navbaer">
        <div className="navbar__logo"></div>
        <button className="navbar__category-btn"></button>
        <div className="navbar_search"></div>
        <ul className="navbar__collaction"></ul>
      </div>
    </div>
  );
}

export default Navbar;
